@everyone 

escuchen esto detenidamente; una alerta urgente, tenga cuidado con un usuario de Discord llamado "sakushuka" con el hashtag #4624. Envía solicitudes de amistad al azar a los usuarios de Discord, y aquellos que acepten las solicitudes de amistad tendrán sus cuentas pirateadas, lo que provocará que los miembros y sus grupos para convertirse en victimas. Corra la voz y envíelo a tantos servidores incompatibles como sea posible. si ve a este usuario, NO acepte la solicitud de amistad y bloquéelo inmediatamente. Discord se esta ejecutando actualmente. ENVIE ESTO A TODOS LOS SERVIDORES en los que te encuentres. Esto es IMPORTANTE:
No aceptes solicitudes de amistad de Shakushuka #4624. Es un hacker. Dígale a todos de los de su lista de amigos porque si alguien en su lista agrega a uno de ellos, estará en su lista. Ellos sabrán de la IP y dirección de tu PC, Así que copie y pegue este mensaje cuídense
